import React from 'react'

const StackBtn = (props)=> {


    let name = props.name.toLowerCase()

    switch (name) {
        case "node":
            name = 'nodejs'
            break;
        case "golang":
            name = 'go'
            break;
        default:
            break;
    }

    return (
      <div className={`stack-btn mr-2 mb-1`}>
        <i
          data-toggle="popover"
          data-content={props.name}
          className={`devicon-${name.toLowerCase()}-plain stack-${name.toLowerCase()}`}
        ></i>
        <a data-toggle="popover" data-content={props.name} href="#">Test</a>
      </div>
    );
}

export default StackBtn
